package com.example.algodesign.problems.string

import android.os.Build
import android.util.Log
import androidx.annotation.RequiresApi
import com.example.algodesign.utils.ProblemInterface
import java.util.*

//https://leetcode.com/explore/challenge/card/may-leetcoding-challenge/537/week-4-may-22nd-may-28th/3337/
class SortCharactersByFrequency : ProblemInterface {

    //cccaaa
    @RequiresApi(Build.VERSION_CODES.N)
    fun frequencySort(s: String): String {
        val mapTemp = HashMap<Char, Int>()
        for(cc in s) {
            mapTemp.put(cc, mapTemp.getOrDefault(cc, 0)+1)
        }
        // val maxHeap: PriorityQueue<Char> = PriorityQueue { a, b -> if (mapTemp.getOrDefault(b, 0) >= mapTemp.getOrDefault(a, 0)) 1 else -1 }
        val maxHeap: PriorityQueue<Char> = PriorityQueue { a, b -> mapTemp.getOrDefault(b, 0) - mapTemp.getOrDefault(a, 0) }
        maxHeap.addAll(mapTemp.keys)

        val sb = StringBuilder()

        while(!maxHeap.isEmpty()) {
            val temp = maxHeap.remove()
            for(x in 0 until mapTemp.getOrDefault(temp, 0)) {
                sb.append(temp)
            }
        }
        return sb.toString()
    }

    @RequiresApi(Build.VERSION_CODES.N)
    override fun execute() {
        Log.v("frequencySort", "frequencySort ${frequencySort("")}")
//        Log.v("frequencySort", "frequencySort ${frequencySort("cccaaa")}")
//        Log.v("frequencySort", "frequencySort ${frequencySort("frequencySort")}")
//        Log.v("frequencySort", "frequencySort ${frequencySort("loveleetcode")}")
//        Log.v("frequencySort", "frequencySort ${frequencySort("aaabbcd")}")
//        Log.v("frequencySort", "frequencySort ${frequencySort("Aabb")}")
    }
}
